//nolint:scopelint
func TestCountValid(t *testing.T) {
	tests := []struct {
		name      string
		aoc       string
		lines     string
		validator func(day2.Row) bool
		want      int
		wantErr   bool
	}{
		{
			name:      "example 1",
			aoc:       "1",
			lines:     list0,
			validator: day2.CanValidate1,
			want:      2,
			wantErr:   false,
		},

		{
			name:      "actual puzzle 1",
			aoc:       "1",
			lines:     list1,
			validator: day2.CanValidate1,
			want:      614,
			wantErr:   false,
		},

		{
			name:      "example 2",
			aoc:       "2",
			lines:     list0,
			validator: day2.CanValidate2,
			want:      1,
			wantErr:   false,
		},

		{
			name:      "actual puzzle 2",
			aoc:       "2",
			lines:     list1,
			validator: day2.CanValidate2,
			want:      354,
			wantErr:   false,
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			got, err := day2.CountValid(tt.lines, tt.validator)
			if (err != nil) != tt.wantErr {
				t.Errorf("CountValid() error = %v, wantErr %v", err, tt.wantErr)

				return
			}

			if got != tt.want {
				t.Errorf("CountValid() got = %v, want %v", got, tt.want)
			}

			fmt.Printf("AdventOfCode/2020/day/2/%s: valid passwords: %d\n", tt.aoc, got)
		})
	}
}
